import styled from "styled-components";


export const HomeStyled = styled.div`
  display: flex;
  flex-direction: column;
  width: 43%;
  justify-content: space-between;
  background-color: azure;
  border-radius: 7px;
  padding: 35px 20px 35px 20px;
  height: 75%;
  border: 1px solid #001529;
`
